import { useNavigate, useParams, useLocation } from "react-router-dom";
import  {  useState } from 'react';

import {
    Alert,
    Button,
    ImageBackground,
    StyleSheet,
    Modal,
    Text,
    Pressable,
    View,
    SafeAreaView,
    TextInput
} from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';
const Navbar = () => {
    const navigate = useNavigate();
    const [str,setStr] = useState("");
    const [ind,setInd] = useState(0);
    const location = useLocation();
    return (
        <SafeAreaView>
            <Text style={styles.buttonOpen}>
            <Pressable>
                <Icon.Button
                    // name="head" 
                    style={styles.buttonOpen}
                    onPress={() => {
                        var c=0;
                        var index=0
                        var path =location.pathname
                        for(var i=0;i<location.pathname.length;i++)
                        {
                            if(location.pathname.charAt(i)=='/')
                            {
                                c++;
                                console.log(i);
                            }
                            if(c==3)
                            {
                                index=i
                                setInd(i);
                                break;
                            }
                        }
                        setStr(location.pathname.substring(0,index)+"/Profile")
                        console.log(str)
                        navigate(str)
                    }}
                >
                   Patient Profile
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => {
                        setStr("/Patient_id/" + useParams()+"Triage")
                        navigate(str)
                    }}
>
                    Triage
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => {
                        setStr("/Patient_id/" + useParams()+"GCS")
                        navigate(str)
                    }}
>
                    GCS
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => {
                        setStr("/Patient_id/" + useParams()+"CRS")
                        navigate(str)
                    }}
>
                    CRS
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => {
                        setStr("/Patient_id/" + useParams()+"PSofa")
                        navigate(str)
                    }}
>
                    PSofa
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => {
                        setStr("/Patient_id/" + useParams()+"Prism")
                        navigate(str)
                    }}
>
                    Prism
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => {
                        setStr("/Patient_id/" + useParams()+"OI")
                        navigate(str)
                    }}
>
                    Oxygenation Index
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => {
                        setStr("/Patient_id/" + useParams()+"API")
                        navigate(str)
                    }}
>
                    API
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => {
                        setStr("/Patient_id/" + useParams()+"Analysis")
                        navigate(str)
                    }}
>
                    Analysis
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => {
                        navigate("/User_id")
                    }}
>
                    Your Profile
                </Icon.Button>
            </Pressable>
            </Text>
        </SafeAreaView>
    );
};
const styles = StyleSheet.create({
    buttonOpen: {
        backgroundColor: "#56BF9C",
    },
    // button:{
    //     backgroundColor: "#569ebf"
    // }
});

export default Navbar;
